const repan_u_codepoint *REPAN_PRIV(u_get_codepoint)(uint32_t chr)
{
    uint32_t offset = ((uint32_t)stage1_map[chr >> 9]) << 5;
    offset = stage2_map[offset + ((chr >> 4) & 0x1f)] << 4;
    offset = stage3_map[offset + (chr & 0xf)];
    return codepoints + offset;
}
